    @constructor(0x1cb5c415, 'vector', use_lru=True)
    def struct_0x1cb5c415(self, datatype, name: str):
        name = 'content'
        return Struct(
            'sname' / Computed('vector'),
            'signature' / Hex(Const(0x1cb5c415, Int32ul)),
            'count' / Int32ul,
            name / Array(this.count, datatype))

